const Body = () => {
  return (
    <>
      <section className="Body">
        <div className="container">
          <div className="left">
            <div className="img">
              <img src="lady.png" alt="lady smiling" id="firstImg" />
            </div>
          </div>
          <div className="left"></div>
        </div>
      </section>
    </>
  );
};
export default Body;
